import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';

class Buttons extends React.Component{
	render(){
		return(
			<Navbar bg="light" expand="lg">
				<Button className="mr-3" onClick={() => this.resetArray(this.state.volume)}>Generate New Array</Button>
				<Button className="mr-3" onClick={() => this.resetArray(this.state.volume)}>Marge Sort</Button>
				<Button className="mr-3" onClick={() => this.resetArray(this.state.volume)}>Quick Sort</Button>
				<Button className="mr-3" onClick={() => this.resetArray(this.state.volume)}>Heap Sort</Button>
				<Button className="mr-3" onClick={() => this.resetArray(this.state.volume)}>Bubble Sort</Button>
			</Navbar>
			)
	}
}

export default Buttons;
